// SPDX-License-Identifier: MIT
pragma solidity >0.8.0 <0.9.0;

contract Faucet {

  event Fund ( address Doner, uint256 amount );
  event Withdraw ( address Reciever, uint256 amount);

  mapping (address => bool) public hasBeenFunded;

  receive() external payable{
    emit Fund(msg.sender, msg.value);
  } 

  function getBTOIS(address luckyGuy) external payable{
      require (hasBeenFunded[luckyGuy]==false, 'Already funded.');

      address payable dest = payable(luckyGuy);
      dest.transfer(10000000 gwei);

      hasBeenFunded[luckyGuy]=true;

      emit Withdraw(luckyGuy, 10000000000000000);
  }
}
